syntax = "proto2";

package com.push;

option optimize_for = SPEED;
option java_package = "com.binance.ws.messages.protobuf.com.search";
option java_multiple_files = true;
option java_outer_classname = "AISearchPushMsgProto";

message AISearchPushMsg {
	required string traceId = 1;
	required string resultId = 2;
}
